// ==UserScript==
// @name         Typeracer: Countdown Alert
// @namespace    http://tampermonkey.net/
// @version      1.0.3
// @description  Adds an alert for the countdown
// @author       altrocality
// @match        https://play.typeracer.com/*
// @match        https://staging.typeracer.com/*
// @icon         https://www.google.com/s2/favicons?domain=typeracer.com
// @noframes
// ==/UserScript==
let delay = true; // When set to 'true' there is an echo. Start typing by the 2nd echo for a fast start!

let normalBeep = new Audio("data:audio/mp3;base64, ");
let startBeep = new Audio("data:audio/mp3;base64, ");
let delayStartBeep = new Audio("data:audio/mp3;base64, ");
let racing = false;
let switchedToMain = false;
let ready = false;
let prevCount = -1;
const newTheme = typeof com_typeracer_redesign_Redesign === "function";

function raceEnd() {
    racing = false;
    ready = false;
    prevCount = -1;
}

var observer = new MutationObserver(() => {
    let gameStatusLabels = document.getElementsByClassName('gameStatusLabel');
    let gameStatus = ((gameStatusLabels || [])[0] || {}).innerHTML || '';
    if (!racing && (gameStatusLabels.length > 0 && (gameStatus == 'Go!' || gameStatus.startsWith('The race is on') || gameStatus == 'The race is about to start!'))) {
        let practiceTitleEl = document.getElementsByClassName('roomSection')[0];
        if(practiceTitleEl && practiceTitleEl.innerText.startsWith('Practice')) {
            if (!switchedToMain) {
                racing = true;
            }
            if (newTheme) {
                document.getElementsByClassName('gwt-Anchor')[3].addEventListener('click', function () {
                    raceEnd();
                    switchedToMain = true;
                });
            } else {
                document.getElementsByClassName('gwt-Anchor')[4].addEventListener('click', function () {
                    raceEnd();
                    switchedToMain = true;
                });
            }
        } else {
            // In a public lobby
            switchedToMain = false;
            var countdown = parseInt(document.getElementsByClassName('lightLabel')[0].parentNode.nextSibling.textContent.substr(-1));
            if (countdown >= 1 && countdown <= 3 && countdown !== prevCount) {
                prevCount = countdown;
                ready = true;
                normalBeep.play();
            } else if (countdown === 0 && ready) {
                racing = true;
                if (delay) {
                    delayStartBeep.play();
                } else {
                    startBeep.play();
                }
            }
        }
    }

    if((racing || ready) && ((document.getElementsByClassName('mainMenuItemText')[0]) || (document.getElementsByClassName('rank')[0].innerText=='Done!'|| document.getElementsByClassName('rank')[0].innerText.includes('Place')))){
        raceEnd();
    }
});
observer.observe(document, {childList: true, subtree: true});
